import React, {Component} from 'react';
import {Link, Route, Switch, Redirect} from 'react-router-dom';
import {Grid, Table} from '@material-ui/core'
import MealPlanMainTable from '../../components/MealPlans/MealPlanMainTable.js'

const MealPlanMain = ({ match }) => {
// para height de containers: height% de containers siblings sume 100%
  return(
    <Grid container style={{height: '100%'}}>
      <Grid container style={{height: '40%'}}>
        <Grid item xs={4}> Coso1</Grid>
        <Grid item xs={4}> Coso2</Grid>
        <Grid item xs={4}> Coso3</Grid>
      </Grid>
      <hr/>

      <Grid container style={{height: '60%'}} >
        <Grid item xs={8} >
          hola
        </Grid>
        <Grid item xs={4}>
          <Grid container>
            <Grid item xs={12}> Grafico1 </Grid>
            <Grid item xs={12}> Grafico 2 </Grid>
          </Grid>
        </Grid>
      </Grid>

    </Grid>

  );

}

export default MealPlanMain;
